import Header from "../components/Header";
import Footer from "../components/Footer";
import { Button, svgIcon } from "@mui/material";
import { Link } from "react-router-dom";
import { useRef } from "react";

const Error = () => {
  const svgIcon = (
    <svgIcon>
      <img alt="circle_button" src="../icon_button.svg" />
    </svgIcon>
  );

  const contactSection = useRef(null);
  const scrollToRef = (ref) => window.scrollTo(0, ref.current.offsetTop);

  return (
    <main className="home-page">
      <img className="home-page-child" alt="" src="../ellipse-55.svg" />
      <img className="mask-group-icon" alt="" src="../mask-group@2x.png" />
      <img className="mask-group-icon1" alt="" src="../mask-group1@2x.png" />
      <img className="home-page-item" alt="" src="../ellipse-54.svg" />
      <img className="home-page-inner" alt="" src="../ellipse-56.svg" />
      <img className="mask-group-icon2" alt="" src="../mask-group2@2x.png" />
      <h1 className="advancing-next-generation">Something went wrong...</h1>
      <Header />
      <div className="ucl-apps-portal">
        Please try again. If the issue persists, contact the site administrator.
      </div>

      <Link to="/" style={{ textDecoration: "none", color: "#000000" }}>
        <Button
          className="browse-available-technologies-home"
          variant="text"
          color="info"
          endIcon={svgIcon}
        >
          Home Page
        </Button>
      </Link>

      <Link
        to="/About/FaqsContact"
        onClick={() => scrollToRef(contactSection)}
        style={{ textDecoration: "none", color: "#000000" }}
      >
        <Button
          className="browse-available-technologies-home"
          variant="text"
          color="info"
          endIcon={svgIcon}
        >
          Contact Us
        </Button>
      </Link>

      <Footer />
    </main>
  );
};

export default Error;
